  true,\n\t\"url\": null,\n\t\"notes\": \"The Federal Aviation Administration (FAA)
  digital-Visual Chart series is designed to meet the needs of users who require georeferenced
  raster images of FAA Visual Flight Rules (VFR) Terminal Area charts. An Aeronautical
  Raster Chart is a digital image of an FAA VFR Chart. All information that is part
  of the paper chart is included in the file. The area inside the neat line is georeferenced
  to the surface of the earth. Only the main body of the chart is accurately georeferenced.
  \ Each digital-Visual Chart is provided in one TIF file. The files are 300 dots
  per inch and 8-bit color.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
